import React from 'react';
import Photo from './Photo/Photo';
// import './ContentWrapper.css';

export default function Photos(props) {
  return (
    <section>
      {props.photos && (
        props.photos.map (
          url =>
          <Photo 
            url={url}
          />
        )
      )}
    </section>
  )
}
